import React from 'react'
import './Card.css';
import Todo from './Todo';
import Data from  './Data.json';

function Card() {
const [title,desc] = Data;
  return (
    <div className="container">
      <Todo title={title}  desc={Data.desc} />
      <Todo title={title}  desc={desc} />
      <Todo title={title}  desc={desc} />
      <Todo/>
  </div>
  )
}

export default Card
